create table users (
	id BIGINT PRIMARY KEY,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	ip_address VARCHAR(20),
	bool VARCHAR(50),
	city VARCHAR(50),
	job_title VARCHAR(50),
	created_at DATE,
	updated_at TIMESTAMP NOT NULL DEFAULT NOW() ON UPDATE NOW(),
	birthday DATE
);
